import React from 'react' 
import 'materialize-css/dist/css/materialize.min.css'
import imagenHero from '../img/playa_del_carmen.jpg'
import './playa_del_carmen.css'

class PlayaDelCarmen extends React.Component {
    render() {
        return(

            <React.Fragment>
    
                <div className="hero"><img src = {imagenHero} alt = "Playa del carmen" width = "100%"/></div>
                <h1 className = "titulo">Playa del <br/>
                Carmen </h1>
                <h3>La riviera maya</h3>

            </React.Fragment>

           
        )
    }
}

export default PlayaDelCarmen
